import React from "react";
import { Link } from "react-router-dom";
import "./Nav.css";

const Nav = () => {
  return (
    <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
      <div class="collapse navbar-collapse" id="navbarNav">
        <ul class="navbar-nav">
          <li class="nav-item">
            <Link class="nav-link" to="/home">
              Home
            </Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link" to="/bovespa">
              Consulta Bovespa
            </Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link" to="/consulta">
              Consulta Empresas
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Nav;
